import React from "react";

function PageAnime() {
  return (
    <div className="container">
      <div class="card p">
        <img class="card-img-top" src="holder.js/100x180/" alt="" />
        <div class="card-body">
          <h4 class="card-title">Title</h4>
          <p class="card-text">Text</p>
        </div>
      </div>
    </div>
  );
}

export default PageAnime;
